import React from "react";

const CollectionPreview = ({ title, items }) => {
  return (
    <div>
      <h1>{title}</h1>
      {items.filter((item, idx) => idx < 4).map((item) => item.name)}
    </div>
  );
};

export default CollectionPreview;
